<script>
function getNumParents(){
	window.parent.window.scrollTo(0, 0);
//	parent.document.scrollTo(0,0);
	// if this is the first load of this page, see whether to show the form or the TY msg
	if(parent.document.getElementById('hiddentick').value == 0){
//		alert(parent.document.getElementById('stdt_lname').value);
//		Connections.-None-.records.IWDF-row-111.685000000003017
//		Connections.-None-.records.IWDF-row-111.685000000003017
		document.getElementById('Connections.-None-.records.IWDF-row-111.685000000003017').value = parent.document.getElementById('stdt_lname').value;
		document.getElementById('Connections.-None-.records.IWDF-row-111.685000000003021').value = parent.document.getElementById('stdt_eml').value;
//		document.getElementById('Connections.-None-.records.IWDF-row-111.685000000029363').value = 'Parent to Child';
		if(parent.document.getElementById('both_parents').checked){
			document.getElementById('ty_2parent').style.display = 'none';
			document.getElementById('form-wrapper').style.display = '';
		}
		else{
			document.getElementById('ty_2parent').style.display = '';
			document.getElementById('form-wrapper').style.display = 'none';
			parent.document.getElementById('IWDF-control-4').style.display = 'none';
		}
	}
	else {
		document.getElementById('ty_2parent').style.display = '';
		document.getElementById('form-wrapper').style.display = 'none';
		parent.document.getElementById('IWDF-control-4').style.display = 'none';
	}
	// now update the value of the hidden field on the parent page to avoid reloading the second form infinitely
	if(parent.document.getElementById('hiddentick').value == 0){
		parent.document.getElementById('hiddentick').value = '1';
	}
//	alert(document.getElementById('Connections.-None-.records.IWDF-row-111.685000000003017').value);
}
function toggleDateDeceasedLI(isChecked){
	if(isChecked){
		document.getElementById('dateDeceasedLI').style.display = '';
	}
	else{
		document.getElementById('dateDeceasedLI').style.display = 'none';
	}
}
</script>
